ConfigV3_v0::numAsicsRead() const{ 
return (this->asicMask() & 0xf)==1 ? 4 : 16; 
}
uint32_t
ConfigV3_v0::roiMask(uint32_t iq) const{ 
return (this->roiMasks() >> (8*iq)) & 0xff; 
}
